import { type } from "@testing-library/user-event/dist/type"


// }

export const addGame = (ga) => {
    return { type: "ADD_GAME", payload: ga }
}
export const loadGame = (myData) => {
    return { type: "LOAD_GAME", payload: myData }
}
export const removeGame=(id)=>{
    return{type:"REMOVE_GAME",payload:id}
}
